  const [query, setQuery] = useState('');

  return (
    <>
      <div className="app">
        <input
          type="text"
          placeholder="Search..."
          className="search"
          onChange={(e) => setQuery(e.target.value)}
        />
        <Table data={[]} />
      </div>
    </>
  );
};
